import React, { Component } from "react";
import Main from "./main";

export class testcomp extends Component {
  render() {
    let people = [
      { id: 1, name: "Adil", age: 17 },
      { id: 1, name: "Danil", age: 18 }
    ]
    let mapping = people.map(person => <Main></Main>)
    return {mapping}
  }
}

export default testcomp;
